import React from 'react'
import Puzzle from './Puzzle'
import Tictac from './tictac'

export default function Home(props) {
  return (
    <div>
      {console.log(props)}
      {
        part == 'Puzzle' ? <Puzzle /> : part == 'Tictac' ? <Tictac /> : <Puzzle/>
      }

    </div>
  )
}
